import React from "react";
import { Routes, Route } from "react-router-dom";

import ArticleMangement from "./ArticleMangement";
import App from "../App";

function Navbar() {
  return (
    <nav>
      <h2>Blog System</h2>
      <div className="nav-right">
        <button>Login</button>
        <main>
          <Routes>
            <Route path="/Article" element={<ArticleMangement />} />
            <Route path="/" element={<App />} />
          </Routes>
        </main>
      </div>
    </nav>
  );
}

export default Navbar;
